import { Routes, Route } from "react-router";
import { routesConfig, ACCESS_LEVELS } from "../common/routes";


export function App() {
    const token = localStorage.getItem('token')
    const role = localStorage.getItem('role')
    if (token === null) {
        return null
    }
    if (role === null) {
        return null
    }

    var routes = [...routesConfig]
    if (role === ACCESS_LEVELS.PUBLIC) {
        routes.filter(r => r.access === ACCESS_LEVELS.PUBLIC)
    }
    else if (role === ACCESS_LEVELS.USER) {
        routes.filter(r => r.access === ACCESS_LEVELS.PUBLIC || r.access === ACCESS_LEVELS.USER)
    }


    return (
        <Routes>
            {routes.map(rout => {
                <Route path={rout.path} element={rout.element} />
            })}
        </Routes>
    );
}
